INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (1, 321, 40011, 125801, 0, 24001, 1, 2, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ");
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (1, 322, 40011, 126001, 0, 24001, 2, 2, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア");
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (1, 323, 40011, 126101, 0, 24001, 3, 2, 1, "んーと。\nこれ、あげる。\nはい", "プレシア");
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 324, 40011, 125801, 0, 24001, 4, 2, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ");
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 325, 40011, 126001, 0, 24001, 5, 2, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア");
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 326, 40011, 126101, 0, 24001, 6, 2, 1, "お兄。\nきてくれて、うれしい", "プレシア");
